function scalePoints(s,t,r)
    nt = {}
    for i,v in ipairs(t) do
        nt[i] = v
        if r then
            nt[i].x = (nt[i].x - .5) * 4
            nt[i].y = (nt[i].y - .5) * 4
        end
        nt[i] = nt[i] * s
    end
    return explodeTable(nt)
end

function presetBody(t,s,speed,fixRot)
    t.x = math.random(WIDTH/5,WIDTH-WIDTH/5)
    t.y = HEIGHT+s.y
    t.angle = math.random(1,4)*90
    t.friction = .7
    local speed = speed or -100
    t.linearVelocity = vec2(0, speed)
    t.gravityScale = 0
    t.restitution = 0
    t.density = 1000
    t.fixedRotation = fixRot or false
end

function pDef()
    return {
        vec2(-10,-10),
        vec2(10,-10),
        vec2(10,10),
        vec2(-10,10)}
end

function pRect(w,h)
    return {vec2(-w,-h),
        vec2(w,-h),
        vec2(w,h),
        vec2(-w,h)}
end

function pTri(w,h)
    return {vec2(-w,-h),
        vec2(w,h),
        vec2(-w,h)}
end

function pCorner(w,h)
    local t = .5
    return {vec2(-w,h),
        vec2(-w,-h),
        vec2(w,-h),
        vec2(w,-h-t),
        vec2(-w-t,-h-t),
        vec2(-w-t,h)}
end

function pDoubleSquare(w,h)
    return {vec2(-w*2,h*2),
        vec2(0,h*2),
        vec2(0,0),
        vec2(w*2,0),
        vec2(w*2,-h*2),
        vec2(0,-h*2),
        vec2(0,0),
        vec2(-w*2,0)}
end

function pT(w,h)
    local t = .6
    return {vec2(-w,h+t),
        vec2(w,h+t),
        vec2(w,h),
        vec2(t/2,h),
        vec2(t/2,-h),
        vec2(-t/2,-h),
        vec2(-t/2,h),
        vec2(-w,h)}
end

function pPoly(nSides)
    local t = {}
    for i = 1,nSides do
        table.insert(t,vec2(math.cos(((math.pi*2)/nSides)*i),math.sin(((math.pi*2)/nSides)*i)))
    end
    return t
end

function halfCircle(nSides)
    local holeScale = 1.05
    local t = {vec2(1,0),vec2(1.5,0),vec2(1.5,-1.2),vec2(-1.5,-1.2),vec2(-1.5,0),vec2(-1,0)}
    local circ = pPoly(nSides)
    for i,v in ipairs(circ) do
        v = v * holeScale
        if v.y <= 0 then
            table.insert(t,v)
        end
    end
    return t
end

function pOval (nSides)
    local scale = vec2(math.random(300,1000)/1000*2,math.random(300,1000)/1000*2)
    local t = pPoly(nSides)
    for i,v in ipairs(t) do
        v.x = v.x * scale.x
        v.y = v.y * scale.y
    end
    return t
end

function pRandPoly(minSides,maxSides,min,max)
    local scale = 1.5
    local t = {}
    local v,m
    local nSides = math.random(minSides,maxSides)
    for i = 1,nSides do
        v = vec2(math.cos(((math.pi*2)/nSides)*i),math.sin(((math.pi*2)/nSides)*i))*scale
        m = math.random(min*100,max*100)/100
        table.insert(t,v*m)
    end
    return t
end

function pStar(minSides,maxSides,minSize,maxSize)
    local sides = math.random(minSides,maxSides)
    local points = {}
    for i = 1,sides do
        table.insert(points, vec2(
                math.cos((rad/sides)*i)*minSize,
                math.sin((rad/sides)*i)*minSize
            )
        )
        table.insert(points, vec2(
                math.cos((rad/sides)*i+(rad/sides/2))*maxSize,
                math.sin((rad/sides)*i+(rad/sides/2))*maxSize
            )
        )
    end
    return points
end

